    service.getTables = function() {
        var options = {};
        options.databaseName = MYSQL.dbName;
        return queryMysql(MYSQL.getTables, options);

    };

    service.getColumns = function(tableName) {
        var options = {};
        options.databaseName = MYSQL.dbName;
        options.tableName = tableName;
        return queryMysql(MYSQL.getColumns, options);
    };

    service.insertRow = function(tableName, attributes) {
        var options = {};
        options.databaseName = MYSQL.dbName;
        options.tableName = tableName;
        options.attributes = attributes;
        return queryMysql(MYSQL.insertRow, options);
    };

    service.getNodes = function (obj) {

        var nodes = [];

        traverse(obj).forEach(function () {
            if (this.level == 1) {
                nodes.push(this.key);
            }
        });
        return nodes;
    };

    service.getAttributesOfNode = function (obj, node) {
        var keys = new Set();
        traverse(obj[node]).forEach(function () {
            if (this.level == 2) {
                keys.add(this.key);
            }
        });
        var keysList = [];
        keys.forEach(function (key, value) {
            keysList.push(value);
        });
        return keysList;
    };

    service.getAttributesValues = function (obj, node, attribute) {
        var listOfValues = [];
        for (var i = 0; i < obj[node].length; i++) {
            var value = traverse(obj[node]).get([i, attribute]);
            listOfValues.push(value);
        }
        return listOfValues;
    };

